GOD BLESS TRUMP! He is bringing back our space program! Do you want us to go to space again! #SHARE if you love Trump so frickin' much! 

Here is the full version of the bill: 
National Aeronautics and Space Administration Transition Authorization Act of 2017

TITLE I--AUTHORIZATION OF APPROPRIATIONS

(Sec. 101) This bill authorizes appropriations to the National Aeronautics and Space Administration (NASA) for FY2017 for:

exploration;
space operations;
science;
aeronautics;
space technology;
education;
safety, security, and mission services;
construction and environmental compliance and restoration; and
the NASA Inspector General.
TITLE II--SUSTAINING NATIONAL SPACE COMMITMENTS

(Sec. 201) The bill expresses the sense of Congress that NASA should be a multi-mission space agency and should have a balanced and robust set of core missions in space science, space technology, aeronautics, human space flight and exploration, and education.

TITLE III--MAXIMIZING UTILIZATION OF THE ISS AND LOW-EARTH ORBIT

(Sec. 301) The bill states that the primary objectives of the International Space Station (ISS) program shall be to:

achieve the long-term goal and objectives for human space flight and exploration as specified in the National Aeronautics and Space Administration Authorization Act of 2010, and
pursue a research program that advances knowledge and provides other benefits to the nation.
The bill restates that it shall be U.S. policy, in consultation with its international partners in the ISS program, to support full and complete utilization of the ISS through at least 2024.

